INSERT INTO `announce` VALUES ('13', 'MAG-INGAT SA MGA MANLOLOKO NGAYONG ARAW NG MGA PUSO!', 'CurrentEvent', 'Pinapaalalahanan ng Philippine Statistics Authority (PSA) na maging alerto sa mga bagong kakilala sa mga dating sites at social media. Huwag magpa-biktima sa identity theft', 'image/philsys.jpg', '2022-05-31 02:52:22', 'Barangay Resident', 'May 27,2022', 'Brgy San isidro');
INSERT INTO `announce` VALUES ('14', 'First love never dies', 'VisitBrgy', 'Syempre dito tayo sa First Love ko - ang Brgy. San Isidro. Kahit napagod ang Konsi sa dami ng ganap, masayang masaya akong makasama kayo. Nandiyan ang Libreng Tuli, Libreng Pet Vaccination, Libreng Gupit, Libeng Bunot ng Ngipin, Libreng Pneumonia Vaccine at filing ng PSA Birth Cerificate na programa ng ating City Mayor Jun-Andeng Ynares at ng Pamahalaang Panlungsod, may kasabay pang palaro ng basketball. Oh, di ba... Basta para sa San Isidro, matic ang support ko. Salamat po sa inyong buong suporta sa Agimat Partylist. ??????\r\nSaludo po ako Mayor Jun-Andeng Ynares sa napakagandang programa. Thank you po Kap Jojo Salen, Kag. Mario Olayvar, Kag. Jojo Bautiata at Dr. Concepcion Lat sa personal ninyong pag-asikaso sa aking mga kabarangay.', 'image/43828635_1915383911850269_6156494327829757952_n.jpg', '2022-05-31 06:32:11', 'Barangay Resident', 'May 1 2022', 'San Isidro');
INSERT INTO `announce` VALUES ('15', 'Libreng Tuli sa Lower San Isidro', 'VisitBrgy', '#LIBRENGTULI2022 kanina sa Barangay San Isidro! \r\nHappy ang Wednesday! Lalo na ang mga kabataang kalalakihan at mga kasamang magulang kanina sa Barangay San Isidro (lower) para sa #LIBRENGTULI2022 handog nina  Deputy Speaker Robbie at Board Member Randy Puno katuwang ang City Government of Antipolo! \r\nKasama din ngayong umaga ang mga Konsehal at kaibigan na sina Agnes Oldan, Doc Rico De Guzman, Atty Jill Tapales, Ate Ja Camacho, Dra. Eileen Zapanta, Kag. Marife Pimentel, at Kag. Bobot Superman Altamirano. \r\nLAST STOP na bukas!  March 18, 2022 - Brgy Beverly Hills at Muntindilaw! \r\nMagpalista sa inyong Barangay.\r\nFirst come, first served. \r\n#SerbisyongTatakPuno?\r\nlibrengtuli2022', 'image/276010130_501650811320936_3269382250691651498_n.jpg', '2022-05-31 06:36:43', 'Barangay Resident', 'May 31 2022', 'San Isidro Brgy Hall');
INSERT INTO `announce` VALUES ('16', 'ALAMIN KUNG SAAN KA BOBOTO!', 'CurrentEvent', 'Sa hudyat ng Commission on Elections (Comelec), maaari nang malaman ng maaga kung saan magtutungo ang mga rehistradong botante ng Barangay San Isidro gamit ang precinct finder o voter verifier para sa nalalapit na halalan sa Mayo 9.\r\nMangyaring i-click lamang ang https://voterverifier.comelec.gov.ph kung saan pwedeng ilagak sa mga blangkong espasyo ang mga pangunahing impormasyon tulad ng buong pangalan at lugar (lalawigan at lungsod) kung saan nagparehistro.\r\nPara lamang sa mga rehistradong botante ang naturang web application na sadyang inilunsad ng Comelec sa hangaring makaiwas sa pagod at aberyang dala ng manu-manong paghahanap ng polling precinct pagsapit ng takdang araw ng Eleksyon 2022.\r\nMay bilang ang bawat Pilipinong rehistrado. Kinabukasan mo, nakasalalay sa boto mo!', 'image/precint-finder-filephoto.jpg', '2022-05-31 06:47:37', 'Barangay Resident', 'May 31 2022', 'San Isidro');
INSERT INTO `announce` VALUES ('17', 'LIBRENG DESLUDGING ', 'CurrentEvent', 'LIBRENG DESLUDGING para sa ating mga kababayan sa mga sumusunod na lugar! ???\r\n??? Phase 1, Barangay San Isidro,\r\n??? Sitio Maligaya area, Barangay San Isidro,\r\n??? Phase 2A Sitio Culdesac , Barangay San Isidro,\r\n??? Sitio Hidden Valley, Barangay San Isidro,\r\n??? Sitio Tanglao, Barangay San Isidro, \r\n??? M.H Del Pilar Barangay San Isidro\r\nSa mga nais mag-avail ng libreng desludging, maaari po kayong makipag-ugnayan sa City Hall - CEWMO (8689-4566) o sa Manila Water Customer Service Hotline (1627) para sa inyong schedule.\r\nNarito ang schedule ng mga barangays ngayong taon:\r\n?Brgy. San Isidro (March to May 2022)\r\n?Brgy. Dalig (May to August 2022)\r\n?Brgy. de la Paz (August to Decemeber 2022)\r\n#FREEDesludging\r\n#ManilaWater\r\n#CEWMOTaskForceManilaBay', 'image/278292949_531769141644025_3926975934995239890_n.jpg', '2022-05-31 06:48:32', 'Barangay Resident', 'April 10 2022', 'San Isidro Antipolo City');
INSERT INTO `announce` VALUES ('18', 'COVID VACCINE SCHEDULE ANNOUNCEMENT', 'SideNews', 'Simula po bukas May 16, 2022 ay mag iikot po ang City Health Office kasama ang ating mga Barangay Health Workers (BHW) upang ihatid ng malapitan ang serbisyo para sa pagbibigay ng Covid Vaccine (Astrazeneca or Moderna) Booster para sa Adults at 2nd dose para sa mga batang edad 8-12 yrs. old. Eto po ang kanilang schedule ng pag iikot:\r\nMay 17 (Tuesday)- M.H. Del Pilar Ext.\r\nMay 18 (Wednesday)- 1st St. Oreta\r\nMay 19 (Thursday)- Saarland Village\r\nPara po sa inyong kaalaman. Salamat po.', 'image/jjVaccine-guillameBr-1285072572-770x533-1.jpg', '2022-05-31 06:49:42', 'Barangay Resident', 'May 16 2022', 'Brgy San Isidro Hall');
INSERT INTO `announce` VALUES ('19', 'nauguration of Multi-purpose Covered Court', 'VisitBrgy', 'Pagkatapos po ng groundbreaking ay saksi pong muli si Konsi Susan sa Inauguration ng Multi-purpose Covered Court kanina sa Empress Subdivision sa aking mahal na Brgy. San Isidro.\r\nParang bata nag enjoy ako sa swing sa palaruan na nandoon. ???\r\nCongrats po Mayor Jun-Andeng Ynares sa isa na namang magandang proyektong para sa mga kabataang Antipolenyo. ??????\r\nMasks off for photo ops only.', 'image/277773677_5100767256647465_2948730455146976557_n.jpg', '2022-05-31 06:50:56', 'Barangay Resident', 'April 2 2022', 'Brgy San Isidro');
INSERT INTO `announce` VALUES ('20', 'Online Application', 'SideNews', 'PAGOD MAN SA HOUSE-TO-HOUSE, WALA NANG PAHI-PAHINGA!\r\nTULOY LANG ANG SERBISYONG TATAK PUNO AT ANG TAUNANG\r\nEDUCATIONAL ASSISTANCE FOR ELEMENTARY AND HIGH SCHOOL STUDENTS MULA SA DISTRITO!\r\n\r\nBASAHIN PO NANG MABUTI ANG ATING MECHANICS PARA SA DSWD EDUCATIONAL ASSISTANCE PARA SA TAONG 2022:\r\n\r\nNarito po ang schedule for application ng educational assistance kada-barangay:\r\n\r\nBARANGAY MAYAMOT â€“ MAY 25, 2022 (ONLINE)', 'image/283850886_544167640402586_90716594939445216_n.jpg', '2022-05-31 06:52:08', 'Barangay Resident', 'May 23 2022', 'Online');
INSERT INTO `announce` VALUES ('21', 'Groundbreaking naman tayo...', 'SideNews', 'Groundbreaking naman tayo...\r\nNagwitness po kami kanina sa Groundbreaking Ceremony para sa itatayong bagong Sports Facility sa ating SportsHub Complex. Ang ating masipag at magaling na Mayor Andeng Ynares ang nanguna sa nasabing event.\r\nMasuwerte ang ating mga kabataan dahil madadagdagan ang mga pasilidad natin sa sports. Ganyan kayo kamahal nina Mayor Jun-Andeng Ynares ??????', 'image/277579630_5100539956670195_6107747367402423912_n.jpg', '2022-05-31 06:53:32', 'Barangay Resident', 'April 2 2022', 'SportsHub Complex');

